import styled from '@emotion/styled'

const Input = styled.input`
    display: block;
    margin: 0 auto;
    width: 500px;
    height: 43px;
    border: none;
    border-radius: 67px;
    margin-left: 240px;
    margin-top: 30px;

    :focus {
        outline: none;
    }
`

const Search = () => (
    <div>
        <Input ></Input>
    </div>
)

export default Search;
